import { FaPen, FaTimes } from "react-icons/fa";

const EmployeeCard = ({member, setModalData}) => {

    return(

        <div className="card-wrapper">
            <img className="card-image" src={`http://localhost:8080/api/images/${member.id}/image/download`} alt={""}/> 
            <ul className="card-text">
                <li>{member.firstName}</li>

                <li>{member.lastName}</li>

                <li>{member.email}</li>
            </ul>
            <td className="actionButtonsWrapper">
                <button className="deleteButton" onClick={() => setModalData({active: false, data: "object", action: "REMOVE"})}><FaTimes className="deleteButtonIcon"/></button>
            </td>
        </div>
    )
}

export default EmployeeCard;
